window.bookSummaryJSON = "<p>Sy<br> <br> I’m no longer <i>a dirty little secret.</i><br> <br> Two powerful heirs now know about Barbie and me, but they intend to keep it that way to protect us.<br> <br> Killian has yet to decide which woman he’ll choose. He can’t have everything—he must choose love or the crown.<br> <br> While Barbie’s luck runs out, my star rises with three heirs courting me. It turns out I’m not just a monster that feeds on sex and violence. I’m what the supernaturals have been searching for.<br> <br> Our brutal father is coming. They say, with the God of Ruin, everything will fall.<br> <br> Barbie and I will stand in his war path, along with our five princes.</p>"; 
